import React from 'react';
import { Link } from 'react-router-dom';
import './Common.css'; // Importujemy wspólny plik CSS

const Home = ({ handleLogout }) => {
    return (
        <div className='home-container'>
            <h1>Home</h1>
            <ul className="menu">
                <li><Link to="/mieszkaniec">Mieszkaniecy</Link></li>
                <li><Link to="/uchwala">Uchwaly</Link></li>
                <li><Link to="/harmonogram">Harmonogram</Link></li>
                <li><Link to="/usterka">Usterki</Link></li>
                <li><Link to= "/liczniki">Liczniki</Link></li>
                <li><Link to ="/rozliczenia">Rozliczenia</Link></li>
            </ul>
            <button className="btn btn-primary logout-button" onClick={handleLogout}>Logout</button>
        </div>
    );
};

export default Home;
